import * as Yup from 'yup';

export const signUpSchema = Yup.object({
    name: Yup.string().required("Please enter your Name").min(4).max(25),
    email: Yup.string().email().required("please enter your Email"),
    contact: Yup.string().required("Please enter your Contact Number").positive().integer(),
    budget: Yup.string().required("Please enter your Budget"),
    country: Yup.string().required("Please enter your Country"),
    id: Yup.string().required("Please enter your Skype ID/Whatsapp No").positive().integer().min(1).max(25).integer(),
    desc: Yup.string().required("Please enter your Description"),
});
